import React from 'react'
import photo from '../../assets/images/simple-doc-port.jpeg'

function PhotoList() {
    return (
        <div>
            <img
            src={photo}
            alt="Portfolio example"
            />
            <PhotoList className="flex-row">
                <img
                    src={photo}
                    alt="Simple Doc"
                    className="img-thumbnail mx-1"
                />
            </PhotoList>
        </div>
    )
}

export default PhotoList;
